import css from "./style.module.css";
import { Link } from "react-router-dom";
import { type } from "os";

interface MenuType {
  categories: {
    id: number;
    type: string;
    label: string;
  }[];
}
export const Menu = (props: MenuType) => {
  return (
   <div>
      {props.categories.map((item) => (

            <Link to={`/${type}`}> {item.label} </Link>

      ))}
</div>
  );
};
<Menu mode = "vertical">
                   {this.props.categories.map((item)=>{
                       return (
                               <Menu.Item className = {css.menu__item}>
                                   <Link to = "/main">
                                       {item.label}
                                   </Link>
                               </Menu.Item>    
                       )
                   })
                   } 
                </Menu>
